-- qn:1
WITH RankedProducts AS (
  SELECT
    id,
    title,
    price,
    category,
    ROW_NUMBER() OVER (PARTITION BY category ORDER BY price DESC, title) AS row_num
  FROM
    products
)
SELECT
  id,
  title,
  price,
  category
FROM
  RankedProducts
WHERE
  row_num <= 5;
-- qn:2
SELECT
  category,
  MIN(price) AS min_price,
  MAX(price) AS max_price,
  AVG(price) AS avg_price
FROM
  products
GROUP BY
  category;
-- qn:3
select * from orders;
select * from products;
