show tables;
SELECT
  p.id AS product_id,
  p.vendor,
  COUNT(o.id) AS order_count
FROM
  orders o
JOIN
  products p ON o.product_id = p.id
GROUP BY
  p.id, p.vendor
ORDER BY
  order_count DESC;
